Fix #issue-1072291456

## Description
This check fixes bug https://github.com/ismail9k/vue3-carousel/issues/133#issue-1072291456

This adds an additional check for the case when `currentSlide` passed to the getSlidesToScroll function as a fraction number. It happens when the last item in non-wrapped carousel is rendered partial

## Code for the component to test

```
<template>
  <Carousel :items-to-show="2.5" :settings="settings" id="hideArrowsExample">
    <Slide v-for="slide in 5" :key="slide">
      <div class="carousel__item">{{ slide }}</div>
    </Slide>

    <template #addons>
      <Navigation />
    </template>
  </Carousel>
</template>

<script>
import { defineComponent } from 'vue';
import { Carousel, Slide, Navigation } from '../../dist/carousel.es';

import '../../dist/carousel.css';

export default defineComponent({
  name: 'HiddenArrows',
  components: {
    Carousel,
    Slide,
    Navigation,
  },
  data() {
    return {
      settings: {
        itemsToShow: 2.5,
        snapAlign: 'start',
      }
    }
  }
});
</script>

<style>
#hideArrowsExample .carousel__prev--in-active,
#hideArrowsExample .carousel__next--in-active {
  display: none;
}
</style>
```

