Migrating to Selenium 4 (#109)

- Updated dependencies;
- TimeUnit.* replaced with Duration.of* in selenium waits;
- Decreased timeout in testShouldBePossibleToSetPageLoadTimeout test from 1s to 300ms;
- Fixed Logger tests and Logger issues;
- TimeUnit.* replaced with Duration.of* in selenium waits; 
- Decreased timeout in testShouldBePossibleToSetPageLoadTimeout test from 1s to 300ms;
- Fixed automationpractice.com tests (added retry)
- Decreased threads count for parallel tests
- Increased retries count for doWithRetry() method;

